import React from 'react'
import { Layout, Main } from "../../components";


export const Home = () => {
    const handleOnClick = () => {
        console.log('HOLA')
    }

    return (
        <>
            <button onClick={handleOnClick}>Agregar</button>
            <Layout>
                <Main>
                    <div>
                        <button onClick={handleOnClick}>Agregar</button>
                    </div>
                </Main>
            </Layout>
        </>
    )
}
